<!doctype html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <title>Regal Essence | Luxury Men's Colognes</title>
  <meta name="description" content="Regal Essence — Luxury men's colognes. Curated scents. Elevated presence." />
  <!--
    This site was hand‑crafted for a luxurious men’s fragrance shop.  The
    design leans into a dark, regal palette with gold accents to evoke a
    premium feeling.  Products are presented in a horizontally scrollable
    row so users can browse the collection like a showcase.  All
    information about pricing and notes are sourced from the official
    Sephora product pages【919320381808540†L41-L66】【405096757553185†L41-L67】.  If you wish to add or
    remove items, simply duplicate or edit the product cards in the
    “Collection” section.
  -->
  <style>
    :root{
      --bg:#07070a;
      --panel:#0e0f14;
      --panel2:#10121a;
      --text:#e9e6df;
      --muted:#b9b3a7;
      --gold:#d7b86a;
      --gold2:#b88a2f;
      --line:rgba(215,184,106,0.22);
      --shadow: 0 18px 50px rgba(0,0,0,.55);
      --radius: 18px;
    }

    *{box-sizing:border-box}
    html,body{height:100%}
    body{
      margin:0;
      font-family: ui-sans-serif, system-ui, -apple-system, Segoe UI, Roboto, Helvetica, Arial, "Apple Color Emoji","Segoe UI Emoji";
      background:
        radial-gradient(1200px 800px at 15% -10%, rgba(215,184,106,0.16), transparent 60%),
        radial-gradient(1000px 650px at 90% 0%, rgba(184,138,47,0.12), transparent 55%),
        radial-gradient(900px 700px at 70% 120%, rgba(215,184,106,0.10), transparent 55%),
        var(--bg);
      color:var(--text);
      letter-spacing:0.2px;
    }
    a{color:inherit; text-decoration:none}
    .wrap{max-width:1180px; margin:0 auto; padding:0 22px}
    /* Pill style for small badges */
    .pill{
      display:inline-flex; align-items:center; gap:10px;
      padding:10px 14px;
      border:1px solid var(--line);
      background:rgba(14,15,20,0.55);
      border-radius:999px;
      backdrop-filter: blur(10px);
      -webkit-backdrop-filter: blur(10px);
      color:var(--muted);
      font-size:13px;
    }

    /* Header styling */
    header{
      position:sticky; top:0; z-index:50;
      background: rgba(7,7,10,0.65);
      border-bottom:1px solid rgba(215,184,106,0.12);
      backdrop-filter: blur(12px);
      -webkit-backdrop-filter: blur(12px);
    }
    .topbar{
      display:flex; align-items:center; justify-content:space-between;
      padding:16px 0;
      gap:14px;
    }
    .brand{
      display:flex; align-items:center; gap:12px;
      min-width:210px;
    }
    .brand strong{
      display:block;
      font-family: ui-serif, Georgia, "Times New Roman", Times, serif;
      letter-spacing:1.2px;
      font-size:18px;
      text-transform:uppercase;
    }
    .brand span{
      display:block;
      font-size:12px;
      color:var(--muted);
      margin-top:2px;
    }
    nav{
      display:flex; align-items:center; gap:18px;
      color:var(--muted);
      font-size:14px;
    }
    nav a{opacity:0.9}
    nav a:hover{color:var(--text)}
    .actions{
      display:flex; align-items:center; gap:10px;
      justify-content:flex-end;
      min-width:210px;
    }
    .btn{
      display:inline-flex; align-items:center; justify-content:center;
      gap:10px;
      border-radius:999px;
      border:1px solid rgba(215,184,106,0.22);
      padding:10px 14px;
      background: rgba(14,15,20,0.65);
      color:var(--text);
      font-size:13px;
      cursor:pointer;
      transition: transform .15s ease, border-color .15s ease, background .15s ease;
      user-select:none;
    }
    .btn:hover{transform: translateY(-1px); border-color: rgba(215,184,106,0.45)}
    .btn.primary{
      background: linear-gradient(135deg, rgba(215,184,106,0.24), rgba(184,138,47,0.10));
      border-color: rgba(215,184,106,0.45);
    }
    .btn.primary:hover{background: linear-gradient(135deg, rgba(215,184,106,0.30), rgba(184,138,47,0.14))}
    .icon{width:16px; height:16px; display:inline-block;}
    .logo-img{
      height:48px;
      width:auto;
      border-radius:12px;
      box-shadow: 0 8px 24px rgba(0,0,0,0.4);
    }

    /* Hero section */
    .hero{padding:58px 0 28px; position:relative;}
    .heroGrid{
      display:grid;
      grid-template-columns: 1.15fr 0.85fr;
      gap:26px;
      align-items:stretch;
    }
    .heroCard{
      border:1px solid rgba(215,184,106,0.18);
      background:
        radial-gradient(800px 360px at 15% 0%, rgba(215,184,106,0.14), transparent 55%),
        radial-gradient(700px 360px at 80% 20%, rgba(184,138,47,0.10), transparent 55%),
        rgba(14,15,20,0.68);
      border-radius: var(--radius);
      box-shadow: var(--shadow);
      overflow:hidden;
      position:relative;
      padding:34px;
      min-height: 420px;
    }
    .heroCard:before{
      content:"";
      position:absolute; inset:0;
      background:
        linear-gradient(90deg, rgba(215,184,106,0.18), transparent 35%),
        linear-gradient(180deg, rgba(0,0,0,0.18), transparent 35%);
      pointer-events:none;
      mix-blend-mode: screen;
      opacity:0.55;
    }
    .hero h1{
      margin:14px 0 12px;
      font-family: ui-serif, Georgia, "Times New Roman", Times, serif;
      font-weight:600;
      line-height:1.04;
      letter-spacing:0.8px;
      font-size:54px;
    }
    .hero p{margin:0; color:var(--muted); font-size:16px; line-height:1.6; max-width: 52ch;}
    .heroCtas{display:flex; gap:12px; margin-top:18px; flex-wrap:wrap}
    .divider{height:1px; background: rgba(215,184,106,0.14); margin:22px 0 16px;}
    .badgeRow{display:flex; gap:10px; flex-wrap:wrap; margin-top:18px;}
    .miniStats{display:grid; grid-template-columns: repeat(3, 1fr); gap:14px; margin-top: 6px;}
    .stat{border:1px solid rgba(215,184,106,0.14); background: rgba(16,18,26,0.62); border-radius: 16px; padding:14px;}
    .stat strong{display:block; color:var(--gold); font-size:18px; letter-spacing:0.4px;}
    .stat span{display:block; color:var(--muted); font-size:12px; margin-top:5px; line-height:1.3;}

    /* Featured panel */
    .featureCard{
      border:1px solid rgba(215,184,106,0.18);
      background: rgba(14,15,20,0.68);
      border-radius: var(--radius);
      box-shadow: var(--shadow);
      overflow:hidden;
      padding:22px;
      position:relative;
      min-height: 420px;
    }
    .spotlight{
      border:1px solid rgba(215,184,106,0.18);
      background:
        radial-gradient(400px 220px at 20% 20%, rgba(215,184,106,0.18), transparent 60%),
        linear-gradient(145deg, rgba(16,18,26,0.80), rgba(14,15,20,0.72));
      border-radius: 18px;
      padding:18px;
      position:relative;
      overflow:hidden;
    }
    .spotlight:after{
      content:"";
      position:absolute; inset:-50%;
      background: conic-gradient(from 240deg, transparent, rgba(215,184,106,0.18), transparent);
      transform: rotate(10deg);
      opacity:0.5;
    }
    .spotlightTop{position:relative; display:flex; align-items:flex-start; justify-content:space-between; gap:12px; z-index:1;}
    .spotlight h3{margin:8px 0 6px; font-family: ui-serif, Georgia, serif; font-weight:600; letter-spacing:0.6px;}
    .spotlight p{margin:0; color:var(--muted); font-size:13px; line-height:1.55; z-index:1; position:relative;}
    .price{color:var(--gold); font-weight:700; letter-spacing:0.4px; font-size:16px; white-space:nowrap; z-index:1; position:relative;}
    .note{margin-top:14px; padding:12px 12px; border:1px solid rgba(215,184,106,0.14); border-radius: 14px; background: rgba(16,18,26,0.62); color:var(--muted); font-size:13px; line-height:1.55;}
    .note b{color:var(--text)}

    /* Section titles */
    section{padding:34px 0}
    .sectionTitle{display:flex; align-items:end; justify-content:space-between; gap:14px; margin-bottom:14px;}
    .sectionTitle h2{margin:0; font-family: ui-serif, Georgia, serif; font-weight:600; letter-spacing:0.6px; font-size:26px;}
    .sectionTitle p{margin:0; color:var(--muted); font-size:13px; max-width: 62ch; line-height:1.5;}

    /* Scrollable row for product cards */
    .scrollRow{
      display:flex;
      overflow-x:auto;
      gap:18px;
      padding-bottom:12px;
    }
    .scrollRow::-webkit-scrollbar{height:8px;}
    .scrollRow::-webkit-scrollbar-thumb{background:rgba(215,184,106,0.3); border-radius:4px;}
    /* Product cards */
    .productCard{
      flex:0 0 260px;
      border:1px solid rgba(215,184,106,0.14);
      background: rgba(14,15,20,0.66);
      border-radius: 18px;
      overflow:hidden;
      transition: transform .15s ease, border-color .15s ease;
      box-shadow: 0 12px 36px rgba(0,0,0,0.32);
    }
    .productCard:hover{transform: translateY(-3px); border-color: rgba(215,184,106,0.30);}
    .productCard img.cardImg{
      width:100%;
      height:160px;
      object-fit:cover;
      border-bottom:1px solid rgba(215,184,106,0.12);
    }
    .cardBody{padding:14px;}
    .kicker{color:var(--gold); font-size:12px; letter-spacing:0.8px; text-transform:uppercase;}
    .cardBody h3{margin:8px 0 6px; font-size:15px; letter-spacing:0.4px; font-family: ui-serif, Georgia, serif; font-weight:600;}
    .cardBody p{margin:0; color:var(--muted); font-size:12.5px; line-height:1.5;}
    .row{margin-top:12px; display:flex; justify-content:space-between; align-items:center; gap:10px; color:var(--muted); font-size:12px;}
    .tag{border:1px solid rgba(215,184,106,0.18); padding:6px 10px; border-radius:999px; background: rgba(16,18,26,0.62); color:var(--text); font-size:12px;}
    /* Hide default shop links since we use cart buttons instead */
    .shopLink{
      display:none;
    }
    /* Style for the add-to-cart buttons inside product cards */
    .smallCart{
      margin-top:10px;
      font-size:12px;
      padding:8px 12px;
    }

    /* Panels for experience section */
    .twoCol{display:grid; grid-template-columns: 1fr 1fr; gap:14px; margin-top:14px;}
    .panel{border:1px solid rgba(215,184,106,0.14); background: rgba(14,15,20,0.66); border-radius: 18px; padding:18px; box-shadow: 0 12px 36px rgba(0,0,0,0.32);}
    .panel h3{margin:0 0 8px; font-family: ui-serif, Georgia, serif; font-weight:600; letter-spacing:0.5px; font-size:18px;}
    .list{margin:0; padding-left:18px; color:var(--muted); font-size:13px; line-height:1.7;}
    .list b{color:var(--text)}

    /* Footer */
    footer{border-top:1px solid rgba(215,184,106,0.12); padding:30px 0 50px; color:var(--muted); font-size:13px;}
    .footerGrid{display:grid; grid-template-columns: 1.2fr 0.8fr 1fr; gap:14px;}
    .inputRow{display:flex; gap:10px; margin-top:10px;}
    input{
      flex:1;
      padding:12px 14px;
      border-radius: 999px;
      border:1px solid rgba(215,184,106,0.18);
      background: rgba(16,18,26,0.70);
      color:var(--text);
      outline:none;
    }
    input:focus{border-color: rgba(215,184,106,0.40)}
    .tiny{font-size:12px; color:rgba(185,179,167,0.85); line-height:1.5}
    /* Responsive */
    @media (max-width: 980px){
      .heroGrid{grid-template-columns:1fr}
      nav{display:none}
      .menuBtn{display:inline-flex}
      .brand{min-width:auto}
      .actions{min-width:auto}
      .hero h1{font-size:44px}
      .footerGrid{grid-template-columns:1fr}
      .twoCol{grid-template-columns:1fr}
    }
    @media (max-width: 520px){
      .hero h1{font-size:38px}
    }
  
    /* Cart / checkout UI */
    .overlay{
      position:fixed; inset:0;
      background: rgba(0,0,0,0.55);
      backdrop-filter: blur(6px);
      -webkit-backdrop-filter: blur(6px);
      z-index:90;
    }
    .cartDrawer{
      position:fixed;
      top:0; right:0;
      height:100vh;
      width:min(420px, 92vw);
      background: rgba(14,15,20,0.92);
      border-left:1px solid rgba(215,184,106,0.18);
      box-shadow: -20px 0 60px rgba(0,0,0,0.6);
      transform: translateX(110%);
      transition: transform .18s ease;
      z-index: 95;
      display:flex;
      flex-direction:column;
    }
    .cartDrawer.open{ transform: translateX(0); }
    .cartHeader{display:flex; align-items:center; justify-content:space-between; gap:12px; padding:16px; border-bottom:1px solid rgba(215,184,106,0.12);}
    .cartTitle{font-family: ui-serif, Georgia, serif; font-weight:600; letter-spacing:.4px; font-size:18px;}
    .cartSub{color: var(--muted); font-size:12px; margin-top:2px;}
    .miniBtn{
      border:1px solid rgba(215,184,106,0.22);
      background: rgba(16,18,26,0.65);
      color: var(--text);
      border-radius: 999px;
      padding:8px 12px;
      cursor:pointer;
      font-size:12px;
    }
    .miniBtn:hover{border-color: rgba(215,184,106,0.45);}
    .miniBtn.danger{border-color: rgba(255,140,140,0.35);}
    .cartItems{padding:14px 16px; overflow:auto; flex:1;}
    .emptyCart{color: var(--muted); border:1px dashed rgba(215,184,106,0.18); border-radius: 14px; padding:14px; text-align:center;}
    .cartRow{display:flex; justify-content:space-between; gap:10px; padding:12px 0; border-bottom:1px solid rgba(215,184,106,0.10);}
    .cartName{font-weight:600; font-size:13px;}
    .cartMeta{color: var(--muted); font-size:12px; margin-top:3px;}
    .cartRowBtns{display:flex; align-items:center; gap:8px; flex-wrap:wrap; justify-content:flex-end;}
    .cartFooter{padding:16px; border-top:1px solid rgba(215,184,106,0.12);}
    .cartTotalRow{display:flex; justify-content:space-between; align-items:center; margin-bottom:10px;}
    .checkoutModal{
      position:fixed; inset:0;
      z-index: 110;
      display:flex;
      align-items:center;
      justify-content:center;
      padding:18px;
      background: rgba(0,0,0,0.55);
      backdrop-filter: blur(8px);
      -webkit-backdrop-filter: blur(8px);
    }
    .checkoutPanel{
      width:min(980px, 96vw);
      max-height: 92vh;
      overflow:auto;
      border:1px solid rgba(215,184,106,0.18);
      background: rgba(14,15,20,0.96);
      border-radius: 20px;
      box-shadow: var(--shadow);
      padding:18px;
    }
    .checkoutTop{display:flex; align-items:flex-start; justify-content:space-between; gap:12px; border-bottom:1px solid rgba(215,184,106,0.12); padding-bottom:12px; margin-bottom:12px;}
    .checkoutGrid{display:grid; grid-template-columns: 1.1fr 0.9fr; gap:14px;}
    .checkoutForm input{width:100%;}
    .fieldRow{display:flex; flex-direction:column; gap:6px; margin-bottom:10px;}
    .fieldRow label{font-size:12px; color: var(--muted);}
    .twoField{display:grid; grid-template-columns: 1fr 1fr; gap:10px;}
    .orderPanel{border:1px solid rgba(215,184,106,0.14); background: rgba(16,18,26,0.62); border-radius: 18px; padding:14px;}
    .orderSummary{margin-top:10px; line-height:1.7;}
    .sumLine{height:1px; background: rgba(215,184,106,0.14); margin:10px 0;}
    .toast{
      position:fixed;
      left:50%;
      bottom:18px;
      transform: translateX(-50%);
      background: rgba(16,18,26,0.92);
      border:1px solid rgba(215,184,106,0.22);
      padding:10px 14px;
      border-radius:999px;
      color: var(--text);
      font-size:13px;
      opacity:0;
      pointer-events:none;
      transition: opacity .18s ease, transform .18s ease;
      z-index: 200;
    }
    .toast.show{opacity:1; transform: translateX(-50%) translateY(-2px);}
    @media (max-width: 920px){
      .checkoutGrid{grid-template-columns:1fr;}
    }

    /* Stripe Payment Link Mode: hide demo card fields; payment happens on the hosted link */
    #cardNumber, #exp, #cvc { display:none; }
    label[for='cardNumber'], label[for='exp'], label[for='cvc'] { display:none; }
</style>
</head>
